import { Image } from "./Image";
import { Title } from "./Title";
import { Author } from "./Author";

const img = "https://m.media-amazon.com/images/I/51xwGSNX-EL._SY445_SX342_.jpg";
const author = "jordan moore";
const title = "ikigai";
export const Book = () => {
  return (
    <article className="book">
      <img src={img}></img>
      <h2>{title}</h2>
      <h4>{author}</h4>
    </article>
  );
};
